import React, { useState, useEffect, useLayoutEffect } from 'react';
import Header from '../../components/main_page/header/Header';
import './admin_page.css';
import UserHomeLayout from '../../layout/UserHomeLayout';
import axios from 'axios';
import { useDispatch } from 'react-redux';
import { getAllStudents } from '../../action/student/studentAction'



function AdminPage() {

    useDispatch(getAllStudents())

    const [user, setUser] = useState({})
    const [message, setMessage] = useState("")

    Effect(() => {
        console.log("IN")
        console.log(sessionStorage.getItem("user"))
        const id = sessionStorage.getItem("user")
        axios.get("http://localhost:8080/admin/find/" + id,).then((response) => {
            if (response.data != "") {
                console.log(response.data)
                setUser(response.data)
            } else {
                sessionStorage.clear()
                setMessage("Error retrieving data, please logout and try again")
                }
            })
        });
        console.log(user)
    return (
        <div className="">
            <Header
                type="ADMIN"
                user={user} />
            {user ? <UserHomeLayout user={user} type="ADMIN" /> : <h3>{message}</h3>}
        </div>
    );

}


export default AdminPage;
